import React from 'react';
import Task from '../components/Task'

class TasksContainer extends React.Component {
    render() {
        const { tasks } = this.props

        return (
            <div className="tasks">
                <h5>Tasks</h5>
                {tasks.map(task => <Task key={task.text} task={task} />)}
            </div>
        )
    }
}

export default TasksContainer;
